Adobe InDesign CS5 on Demand

Need answers quickly? Adobe InDesign CS5 on Demand provides those answers in a visual step-by-step format. We will show you exactly what to do through lots of full colour illustrations and easy-to-follow instructions.

Includes
Workshops
ACE Exam Objectives
More than 500 Essential InDesign CS5 Tasks

Inside the Book

Improve publishing and productivity with the CS5 interface
Browse, organize, and process files using Adobe Bridge or Mini Bridge
Create and manage pages and books to keep track of your documents
Transform and reshape objects to create a new look
Create text and apply styles to display artistic text
Use track changes and CS Review to share and review content
Create interactive PDFs for use on the web
Create output for commercial print purposes

